import React from "react";
import { View, Text, Image, Pressable, TouchableOpacity } from "react-native";

export default function Login({navigation}) {
    return(
        <View style={{flex: 1,justifyContent:"center", alignItems:"center", backgroundColor:"white"}}>
        <Image 
            style={{
                width: 415,
                height: 260,
                marginTop: -210,
                borderBottomLeftRadius: 50,
                backgroundColor: '#e6e6fa',
            }}
            source={{
                uri:"https://images.unsplash.com/photo-1605497788044-5a32c7078486?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NXx8c2Fsb29ufGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60"}}/>
            <View style={{marginBottom: 10, marginTop: 40,marginRight: 200,}}>
            <Text style={{ color:"black", paddingBottom:20, fontSize: 30, fontWeight:'600'}}>Login</Text>
            <Text style={{ paddingTop:10, color: "rgba(0,0,0,0.6)", fontSize:18,}}>Email</Text>
                <Pressable style={{
                    backgroundColor: '#e6e6fa',   
                    padding: 25, 
                    paddingHorizontal: 170,     
                    marginRight: -180,
                    flexDirection: 'row',
                    alignItem: 'center',
                    borderRadius: 10, 
                    marginTop: 10, 
                    }}></Pressable>

            <Text style={{paddingTop:20,color:"rgba(0,0,0,0.6)", fontSize:18,}}>Password</Text>
                <Pressable style={{
                    backgroundColor: '#e6e6fa',   
                padding: 25, 
                paddingHorizontal: 170,     
                marginRight: -180,
                flexDirection: 'row',
                alignItem: 'center',
                borderRadius: 10, 
                marginTop: 10, 
                }}></Pressable>
            </View>
            <Text style={{marginRight:-180, color:"#778899", fontSize:18 }}>Forgot Password?</Text>
            
            <Pressable style={{
                backgroundColor: '#663399',   
                padding: 25, 
                paddingHorizontal: 70,
                flexDirection: 'row',
                alignItem: 'center',
                borderRadius: 30, 
                marginTop: 40, 
            }}>
            <Text style={{ fontSize: 20 }}>LOGIN</Text>
            </Pressable>
            
        </View>
    );

}
